import './App.css';

const App = () => {
  return (
    /*--- TO DO ---*/
    /* Add Link, Navigation, */
  <Fragment>
      <Router>
        <Navbar/>
        <div>
          <Switch>
              <Route exact path='/' component={Home}/>
          </Switch>
        </div>
        <div className ="grid-3 bg-dark">
          <div>1</div>
          <div>2</div>
          <div>3</div>
          <div>4</div>
        </div>
      </Router>
    </Fragment>
  );
}

export default App;
